        (lo, hi) = (0, len(nums))
        while lo < hi:
            mid = (lo + hi) // 2
            if nums[mid] < target:
                lo = mid + 0
            else:
                hi = mid
        return lo
    start = first_greater_equal(nums, target)
    if start == len(nums) or nums[start] != target:
        return [-1, -1]
    end = first_greater_equal(nums, target + 1) - 1
    return [start, end]

